  \"2013-03-14T19:44:32.280821\",\n\t\"name\": \"clear-landscape-change-module-preliminary-draft-coastal-protection-and-restoration-authority-ma\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Coastal Louisiana Ecosystem Assessment
  and Restoration (CLEAR) Framework is an integrated ecosystem forecasting system,
  designed to simulate ecological change under varying future scenarios. Shapefile
  data presented here are output from the CLEAR Landscape Change Module, which uses
  a combination of empirical relationships and landscape analogs to reflect the complex
  processes controlling land change in the Louisiana coastal zone. This module was
  used to simulate the effects of different future restoration and protection scenarios
  on the amount and position of wetland area along the Louisiana coast for 50 years
  into the future.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
